import React from "react";
import { useHistory, useParams } from "react-router-dom";
 const Page2 = () => {
    let history = useHistory();
    const { phone, amount,remark } = useParams();
    return (
      <div>
        <h1>phone:{phone}</h1>
        <h1>amount:{amount }</h1>
        <h1>remark:{remark }</h1>
      </div>
    )
};

export default Page2;
